import React from 'react';
import './components/global.css';
import { BrowserRouter } from 'react-router-dom';
import Header from './components/Header';
import Routes from './routes';

function App() {
  return (
    <BrowserRouter>
      <Header />
      <Routes />      
    </BrowserRouter>
  );
}

export default App;
